import { Region, State } from '../../modules/auth/components/SinUpForm';
import { ERROR_MESSAGE, GET_REGION_SUCCESS, GET_STATE_SUCCESS } from '../actions/actionSignUp';
const initialState = {
  region: [],
  state: [],
  loading: false,
  errorMessage: '',
};
interface Action {
  type: string;
  payload?: any;
}
export interface InitSignup {
  region: Region[];
  state: State[];
  loading: boolean;
  errorMessage: string;
}
const SignUpReducer = (state = initialState, action: Action) => {
  switch (action.type) {
    case GET_REGION_SUCCESS:
      return {
        ...state,
        region: action.payload,
      };
    case GET_STATE_SUCCESS:
      return {
        ...state,
        state: action.payload,
      };
    case ERROR_MESSAGE:
      return {
        errorMessage: action.payload,
      };
    default:
      return state;
  }
};
export default SignUpReducer;
